import React from 'react'
export default function Home() {
  return (
    <div>
      <div class="mt-20 flex flex-col col-2 items-center pb-10">
        <img class="mb-5 w-80 h-80 rounded-full shadow-lg" src='head.jpeg' alt='head shot of Rod Raymond'/>
        <hr class="my-6 border-gray-200 sm:mx-auto dark:border-green-700 lg:my-8" />
      </div>

    </div>
  )
}
